import React, { Component } from 'react';

class ProgressComponentItem extends Component {
  render() {
    const styles = {
      width: `${this.props.porcentage}%`,
    }

    let title = this.props.title.toUpperCase()

    if(title == 'BACK END') {
    }

    return (
      <div className="progress-item">
        <span className="progress-title">{title}</span>
        <div className="progress">
           <div style={styles} className="progress-bar" role="progressbar" aria-valuenow={this.props.porcentage} aria-valuemin="0" aria-valuemax="100">
              <span className="progress-percent"> {this.props.porcentage}%</span>
           </div>
        </div>
     </div>
    )
  } 
}

class ProgressComponent extends Component {
  render() {
    return (
      <div className="progress-wrapper">
         <ProgressComponentItem title={"FRONT END"} porcentage={62}  />
         <ProgressComponentItem title={"BACK END"} porcentage={90}  />
         <ProgressComponentItem title={"WRITING"} porcentage={75}  />
         <ProgressComponentItem title={"DESIGN"} porcentage={100}  />
         <ProgressComponentItem title={"english"} porcentage={68}  />
         <ProgressComponentItem title={"FISHING"} porcentage={85}  />
         <ProgressComponentItem title={"SMOKING"} porcentage={200}  />
         <ProgressComponentItem title={"CYCLING"} porcentage={84}  />
      </div>
    );
  }
}

export default ProgressComponent;
